import json
import urllib.request
from html.parser import HTMLParser
alldatas = []
class MyHTMLParser(HTMLParser):
    def __init__(self, isget):
        super(MyHTMLParser,self).__init__()
        self.isget = isget
        self.istd = False
        self.ispageinfo = False
        self.datas = []
        self.tddata = ''
        self.pagecount = 0
    def handle_starttag(self, tag, attrs):
        if tag == 'td': 
            self.istd = True
            self.tddata = ''
        if tag == 'span' and self.isget:
            for name, value in attrs:
                if name == 'id' and value == 'PageInfo':
                    self.ispageinfo = True            
    def handle_endtag(self, tag):
        if tag == 'td':
            self.datas.append(self.tddata)
            self.istd = False  
        if tag == 'tr' and not self.isget:             
            if len(self.datas) == 11 and self.datas[1] != '':
                #print(str(len(self.datas))+' '+self.datas[1])   
                alldatas.append(dict({'serial2':self.datas[2],'objtype':self.datas[5],'keeper':self.datas[7],'contactphone':self.datas[9],'lostdate':self.datas[3],'objname':self.datas[6],'lostplace':'臺鐵-'+self.datas[4],'serial':'TRA-'+self.datas[1]}))            
            self.datas = []
    def handle_data(self, data):
        if self.istd:            
            self.tddata = data               
        if self.ispageinfo:
            self.pagecount = int(data.split('/')[1].strip().split(' ')[0])
            self.ispageinfo = False        
req = urllib.request.Request("http://www.railway.gov.tw/tw/lost_List.aspx")  
req.add_header('User-Agent','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.3 Safari/537.36')
response = urllib.request.urlopen(req)
docStr = response.read().decode('utf8') 
parser = MyHTMLParser(True)
parser.feed(docStr)
pagecount = parser.pagecount
parser.close()  
